definitions:
  Statistical uncertainty:
    description: Total (correlated) statistical uncertainty with correlation matrix.
    treatment: ADD
    type: CORR
  Luminosity:
    description: Systematic uncertainty from the luminosity.
    treatment: ADD
    type: CORR
  Efficiency:
    description: Correlated uncertainties from the selection efficiencies with correlation
      matrix.
    treatment: MULT
    type: CORR
  Background uncorrelated:
    description: Background contributions from heavy flavours, misidentified hadrons
      and physics processes.(uncorrelated)
    treatment: MULT
    type: UNCORR
  Background correlated:
    description: Background contributions from heavy flavours, misidentified hadrons
      and physics processes.(correlated)
    treatment: MULT
    type: CORR
  Final state radiation uncorrelated:
    description: Correlated uncertainties from final state radiation corrections.(uncorrelated)
    treatment: MULT
    type: UNCORR
  Final state radiation correlated:
    description: Correlated uncertainties from final state radiation corrections.(correlated)
    treatment: MULT
    type: CORR
  Closure uncorrelated:
    description: Correlated uncertainties from closure test.(uncorrelated)
    treatment: MULT
    type: UNCORR
  Closure correlated:
    description: Correlated uncertainties from closure test.(correlated)
    treatment: MULT
    type: CORR
  Alignment uncorrelated:
    description: Correlated uncertainties from detector alignment and momentum scale
      calibration.(uncorrelated)
    treatment: MULT
    type: UNCORR
  Alignment correlated:
    description: Correlated uncertainties from detector alignment and momentum scale
      calibration.(correlated)
    treatment: MULT
    type: CORR
  Unfold:
    description: Correlated uncertainties due to unfolding corrections applied only
      to pT.
    treatment: MULT
    type: UNCORR
